import axios from 'axios'
import React, { useEffect } from 'react'
import { useParams } from 'react-router-dom'

export default function Profile() {

   var {id} = useParams()

   useEffect(()=>{
    axios.get(`https://jsonplaceholder.typicode.com/users/${id}`)
    
   },[])

  return (
    <div>
        <h1>profile</h1>
        <h1>{id}</h1>
    </div>
  )
}
